import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.header`
  background-color: #282c34;
  min-height: 10vh;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  font-size: calc(10px + 2vmin);
  color: white;
  padding: 0 20px;
`;

const Logo = styled.img`
  height: 50px;
  margin-left: 10px;
`;

const Title = styled.h1`
  display: flex;
  align-items: center;
`;

const Header = () => {
  return (
    <HeaderContainer>
      <Title>
        PrețMonitor
        <Logo src="/logo.png" alt="PrețMonitor Logo" />
      </Title>
    </HeaderContainer>
  );
};

export default Header;
